import React, { useState, useEffect } from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './css/App.css';
import NavBar from './components/NavBar';



function App() {
<img src="/images/bg.png" alt="fg" />
  return (
    <BrowserRouter>
    <div className="App">
      <div className="container">
    <Switch>
      <Route exact path="/">
        <NavBar></NavBar>
      </Route>
    </Switch>
    </div>
    </div>
    </BrowserRouter>
  );
}

export default App;
